<!DOCTYPE html>
<html>
    <head>
        <meta charset="UTF-8" />
        <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
        <meta name="viewport" content="width=device-width,initial-scale=1" />

        <link rel="stylesheet" href="https://cdn.jsdelivr.net/npm/docsify-themeable@latest/dist/css/theme-simple-dark.css" />
    </head>
    <body>
        <div id="app"></div>
        <script>
            window.$docsify = {
                name: "arbitrator",
                repo: "https://github.com/softvisio/arbitrator",
                coverpage: true,
                loadSidebar: true,
                logo: "assets/logo.png",
                relativePath: true,
            };
        </script>
        <script src="//cdn.jsdelivr.net/npm/docsify"></script>
        <script src="//cdn.jsdelivr.net/npm/docsify-themeable"></script>
        <script src="//cdn.jsdelivr.net/npm/prismjs"></script>
        <script src="//cdn.jsdelivr.net/npm/docsify/lib/plugins/search.min.js"></script>
        <script src="//cdn.jsdelivr.net/npm/docsify/lib/plugins/zoom-image.min.js"></script>
        <script src="//cdn.jsdelivr.net/npm/docsify-tabs"></script>
        <script src="//cdn.jsdelivr.net/npm/docsify-copy-code"></script>
        <script src="//cdn.jsdelivr.net/npm/docsify-pagination"></script>
    </body>
</html>
